import styled from "styled-components";

export const CommonButton = styled.button`
  background-color: #408ef1;
  margin: 4px;
  padding: 10px;
  box-shadow: inset 0 1px 0 0 hsl(0deg 0% 100% / 40%);
  border-radius: 16px;
  color: white;
  font-size: 8px;
  border: 1px solid;
  cursor: pointer;
`;
